const todasIslas = [
  municipiosFuerteventura,
  municipiosLanzarote,
  municipiosGranCanaria,
  municipiosElHierro,
  municipiosLaPalma,
  municipiosLaGomera,
  municipiosTenerife,
];

export default function CanariasMapa()
{
  const [selected, setSelected] = useState(null);

  return (
    <div style={{ display: "flex", flexDirection: "column", height: "100vh" }}>
      {/* Header encima */}
      <header style={{ padding: "0px", background: "#eee" }}>
        <h1>Mapa de Canarias</h1>
      </header>

      {/* Contenido debajo del header */}
      <main style={{ display: "flex", flex: 1, overflow: "hidden" }}>
        {/* SVG ocupa todo el espacio disponible a la izquierda */}
        <div style={{ flex: 1, display: "flex", justifyContent: "center", alignItems: "center" }}>
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="100%"
            height="100%"
            viewBox="0 0 777.74173 413.26299"
            preserveAspectRatio="xMidYMid meet"
            style={{ border: "1px solid #ccc", maxHeight: "100%", maxWidth: "100%" }}
          >
            {todasIslas.flat().map(({ name, path }) => (
              <path
                key={name}
                d={path}
                fill={selected === name ? "#FFD21F" : "#cce"}
                stroke="#336"
                strokeWidth="2"
                onClick={() => setSelected(name)}
                style={{ cursor: "pointer" }}
              />
            ))}
          </svg>
        </div>

        {/* Panel lateral */}
        <aside
          style={{
            width: "250px",
            padding: "16px",
            borderLeft: "1px solid #ddd",
            background: "#f9f9f9",
          }}
        >
          <h2>Información</h2>
          {selected ? (
            <p>
              Has seleccionado: <b>{selected}</b>
            </p>
          ) : (
            <p>Haz click en un municipio</p>
          )}
        </aside>
      </main>
    </div>
  );
}
